import { ReactElement } from "react";
import { TechBox } from "./style";
import { Card } from "../card/card";
import { Button } from "../button/button";
import { AddIconn } from "@m"
export const Tech = (): ReactElement => {
  return (
    <TechBox >
      <Card>
        <p>Fuck you</p>
        <Button size="lesser" variant="text_button" variant_hover="text_button_hover" >
            <AddIcon/>
        </Button>
      </Card>
    </TechBox>
  );
};
